import React from "react";
import AboutTemplate from "./AboutTemplate";
import data from '../../data/aboutPhilData'

function AboutPhil() {
  return (
    <div>
      <AboutTemplate
        proRideImg={data.img}
        proRideImg2={data.img2}
        text1={data.text1}
        text2={data.text2}
        header={data.header}
      />
      <Link to="/aboutProRide" className="text-info">
              Learn about us as a company
            </Link>
    </div>
  );
}

export default AboutPhil;
